data.text:
@guidurang Hola Guillermo, gracias por comunicarnos por este medio. 

¿Nos podrías enviar un DM con la información de tu reserva y/ número de boleto?

Un saludo.

@RAUMELSarah Nous ne transmettons pas d'adresse postale et vous invitons à nous écrire en DM. Un conseiller pourra vous assister et transmettra votre requête aux personnes compétentes si besoin. 
Merci de votre compréhension. 
Sandrine

@RAUMELSarah @RAUMELSarah, les réclamations sont à envoyer par ici https://t.co/5As69j8ZCT. 
Bonne fin de journée, 
Sandrine

@DuquenneFred Nous prenons en compte votre remarque @DuquenneFred et la transmettons aux personnes concernées. 
Merci encore pour votre message. 
Sandrine

@MarieBGriffin2 Hi @MarieBGriffin2, we invite you to make your request here ➡ https://t.co/2h3wz5Tb40
Thank you, 
Sandrine

@DuquenneFred Bonjour @DuquenneFred, nous espérons que ce moment à bord avec nous vous aura enchanté ! 
Bonne fin de journée, 
Sandrine

@RAUMELSarah Bonjour  @RAUMELSarah, vous ne pourrez être assistée qu'en messagerie privée. Comme proposé en amont, nous vous invitons à contacter nos équipes du service client en DM. 
Merci pour votre compréhension. 
Sandrine

@raionmarugaos Bonjour @raionmarugaos, pouvez-vous nous envoyer un DM détaillé afin qu'un conseiller puisse vous assister s'il vous plait ? 
Merci et bonne fin de journée, 
Sandrine

@andrezstar Bonjour @andrezstar, pas d'inquiétude, vous pourrez l'imprimer à l'aéroport et ça ne change rien à votre enregistrement si vous l'avez bien finalisé. 
Nous vous souhaitons un bon voyage !
Sandrine

@stephan1711 Bonjour @stephan1711, à priori une réponse satisfaisante vous a été apportée en DM et nous en sommes ravis. 
Bon voyage ! 
Sandrine

@SnehRams Bjr @SnehRams, le volume de demande en hausse depuis la pandémie provoque un retard dans les traitement des dossiers. Nous vous prions de nous excuser pour ces désagréments. 
Un conseiller peut vous assister sur votre demande actuelle en DM si vous le souhaitez. 
Bonne journée.

@Garque243 Bonjour @Garque243, toutes les infos sur les conditions sanitaires pour voyager sont à retrouver par ici ➡https://t.co/itYFOD06eB
Bon voyage !
Sandrine

@Cristian20 Bonjour @Cristian20, un conseiller est revenu vers vous en DM. Nous vous invitons à reprendre cet échange avec lui.
Bonne journée !
Sandrine

@Paoferzuli Bonjour @Paoferzuli, vous pouvez voyager en cabine avec votre robe bien emballée afin qu'elle réponde aux exigences de transport. En revanche, elle comptera pour un bagage cabine. 
Bon voyage et félicitations !
Sandrine

@mverdun Bonjour  @mverdun, merci pour votre message et votre patience surtout. Nous sommes conscients des difficultés que vous pouvez rencontrer lors de vos démarches et nos équipes restent mobilisées. 
Bonne journée, 
Sandrine

@FlorantDjole Hi  @FlorantDjole, please kindly DM us your booking details in order to be assisted promptly. 
Thank you. 
Sandrine

@PaulDeBordeaux Bonjour @PaulDeBordeaux, votre demande est en cours de traitement auprès de notre service de remboursement. 
Bonne fin de journée, 
Sandrine

@NanouCs Bonjour @NanouCs, pouvez-vous nous envoyer les détails de votre demande en DM s'il vous plait ? 
Nous restons à votre écoute. 
Sandrine

@ti_tom Bonjour @ti_tom, nous nous renseignons à ce sujet et revenons vers vous dès que possible. 
Bonne fin de journée, 
Sandrine

@FramGommendy Thank you @FramGommendy for sharing these warmful words. 
Have a great day, 
Sandrine

@ThomMerce Bonjour @ThomMerce, nous vous invitons à contacter un conseiller en DM afin d'obtenir les informations concernant cette modification de voyage. 
Bonne journée, 
Sandrine

@mimadrid Hi @mimadrid, you 'll find out information regarding the sanitary measures for travelling on our dedicate page ➡https://t.co/itYFOD06eB
Have a good day, 
Sandrine

@111publishing Hi  @111publishing, we are waiting for you in DM if you still need some help. 
Have a good day, 
Sandrine

@adultprodigy8 Hi @adultprodigy8, our customer support team is available in DM if you need to make a claim. 
We remain at your disposal, 
Sandrine

@MarSodac Bonjour @MarSodac, pouvez-vous nous faire parvenir en DM les détails de votre réservation s'il vous plait ? 
Merci et bonne fin de journée, 
Sandrine

@Sam_Gzl Bonjour @Sam_Gzl, nous espérons que l'échange avec le conseiller qui vous assiste vous a permis de finaliser votre demande d'avoir. 
Bonne fin de journée, 
Sandrine
